I am proud to have successfully secured critical funding that directly benefits families in Collier and Miami-Dade counties. This funding will support Community Health Centers, expand Alcee Hastings Advanced Cancer screenings, advance groundbreaking research at Florida  International University, and support pediatric care by funding graduate medical education. 

This legislation ensures families have access to life-saving treatments and prepares the next generation of healthcare providers.

