Earlier this month, I had the pleasure of meeting with Sergio Massa, co-chairman of PAPO-USA and a recognized Peruvian leader from Florida, as well as with representatives from the Peruvian American Political Organizations (PAPO-USA).
 
As a Member of the Congressional Caucus on Peru, I was honored to be able to meet with members of PAPO-USA and I look forward to continuing to strengthen the bilateral relationship between the United States and Peru.

@papo_usa

It was a pleasure to meet with Secretary General of the Organization of American States (OAS), Albert Ramdin, to discuss some of the most pressing issues facing the Western Hemisphere—issues that are critical to U.S. national security. These include countering the malign influence of Communist China and Russia, combatting narco-trafficking, transnational crime, corruption, and terrorism, and supporting freedom and democracy in oppressive and politically unstable countries such as those in Cuba, Venezuela, Nicaragua and Haiti.

I also reiterated my strong support for the candidacy of @PayaIACHR to serve on the Inter-American Commission on Human Rights. @CIDH 

I look forward to working with Secretary General Ramdin on these vital priorities.

