A true privilege to speak at this hearing on "The Future of Iran," organized by @OrgIAC.

@Maryam_Rajavi inspires us all and understands that the cause of a free Iran is alive and will succeed.

Regime change in Iran is a service to humanity. Iran will be free because of leaders like Mrs. Rajavi and many others who continue to fight and work towards the inevitable day of freedom.

The dangerous Biden-Harris Administration’s open-border policies of the past four years have cost the lives of too many innocent Americans, including Border Patrol agents and law enforcement officers.
 
Today I proudly voted in favor of @RepCiscomani’s bill H.R. 35, the Agent Raul Gonzalez Officer Safety Act, which increases penalties for criminals who engage in high-speed chases with local and federal law enforcement. Agent Raul Gonzalez, a dedicated Border Patrol agent, tragically lost his life while pursuing illegal activity during such a chase.
 
@HOUSEGOP’s message is clear: We will CRACK DOWN on drug traffickers, cartels, and other criminals who endanger American lives–and we will hold them fully accountable under the rule of law.

Díaz-Balart, Giménez, y Salazar se solidarizan con el pueblo venezolano. Lea la declaracíon conjunta aqui⬇️

"El presidente Trump ha mostrado una solidaridad firme e  inquebrantable con el pueblo venezolano, incluyendo la protección de  aquellos que huyen de la opresión, el apoyo a la valiente oposición  democrática, y la imposición de sanciones contundentes contra la  dictadura de Maduro. Continuaremos trabajando con la Administración  hacia una política exterior que proteja los intereses de seguridad  nacional de los EE.UU., mantenga a los americanos seguros y defienda los  derechos humanos y la democracia, mientras enfrentamos a los dictadores  en nuestro hemisferio.

El pueblo venezolano ha  soportado represión, corrupción y abusos a los derechos humanos durante  demasiado tiempo en Venezuela, y aún para muchos no es seguro para  muchos regresar. Continuaremos haciendo todo lo posible para garantizar  que aquellos que buscan libertad por la persecución y la opresión estén  protegidos".

@RepCarlos 
@RepMariaSalazar

Díaz-Balart, Giménez, and Salazar stand in solidarity with the Venezuelan people. Joint statement below⬇️

"President Trump has shown steadfast and unwavering solidarity with the Venezuelan people, including by protecting those fleeing oppression, supporting the courageous democratic opposition, and imposing tough sanctions on the Maduro dictatorship. We will continue to work with the administration toward a foreign policy that protects U.S.  national security interests, keeps Americans safe, and defends human rights and democracy while standing up to the dictators in our hemisphere.

"The Venezuelan people have endured repression, corruption, and human rights abuses for far too long in  Venezuela, and it is still not safe for many to return. We will continue  to do everything possible to ensure that those seeking freedom from persecution and oppression are protected."

@RepCarlos 
@RepMariaSalazar

For the past four years, Americans have been victims of the Biden-Harris admin’s dangerous open border policies, leading to the murders of innocent Americans such as Laken Riley, Rachel Morin, and Jocelyn Nungaray.
 
That’s why I proudly supported passage of S. 5–Laken Riley Act, which gives ICE more resources to restore the rule of law and prevent these avoidable, horrific crimes.
 
@HouseGOP is keeping our promise to secure the border and protect Americans.

