It was an honor to meet with Ambassador @rramirezlezcano, Foreign Minister of Paraguay, and José Antonio Dos Santos current Ambassador of the @paraguayinUSA.

We had a productive discussion about our shared national security interests and objectives, reinforcing the strong partnership between the United States and Paraguay.

I look forward to deepening our collaboration to promote democratic values in our region and around the world, including our steadfast support for our mutual friend and ally, Taiwan.

